import React from 'react'
import { useState, useEffect } from 'react';
import axios from "axios"

function Part1() {

    const [vehicles, setVehicles] = useState([])

    const getVehicles = async() =>{
        
        const response = await axios.get('https://swapi.py4e.com/api/vehicles')
        console.log(response.data.results)

        setVehicles(response.data.results)
    }

    useEffect(() =>{
        
        getVehicles()
        
    }, [])
    
    function largestVehicle (vehicles) {
        let largestV = vehicles.reduce(function(prev, current) {
            return (prev.passengers > current.passengers) ? prev : current
        })
        return largestV
    }
    largestVehicle (vehicles)

    return (
        <div>
            Part 1:
            
            {vehicles.map(vehicle => {
               return <div>{vehicle.name} {vehicle.passengers}
               </div> 
               
            })}

            
        </div>
    )
}

export default Part1
